import { AGREGAR_BUSQUEDA } from "./acciones";



const estadoInicial ={
    contenidoBusqueda: [],
    termino: ""
}

export function ImagenesReducer (estado = estadoInicial,accion ){
switch(accion.type){
case AGREGAR_BUSQUEDA:
    return{...estado,contenidoBusqueda: accion.carga}
    default: return estado
}
}
